import React from 'react';

function Product(props) {
  return (
    <div className="child">
      <img src={props.image} alt={props.name} />
      <p>
        <strong>{props.name}</strong>
        <br />
        {props.price}դր/1կտ
        <br />
        <button className="btn">Գնել</button>
      </p>
    </div>
  );
}
  
  

export default Product;
